INSERT INTO `incidencia` VALUES (1, '<p>Se procedió a desbloquear el cliente&nbsp;<span style=\"color: rgb(51, 51, 51); font-family: Calibri, sans-serif; font-size: 14.6667px;\">DUOPRINT</span><span style=\"color: rgb(51, 51, 51); font-family: Calibri, sans-serif; font-size: 14.6667px;\">&nbsp;con RUC&nbsp;</span><span style=\"color: rgb(51, 51, 51); font-family: Calibri, sans-serif; font-size: 14.6667px;\">0992670835001</span><span style=\"color: rgb(51, 51, 51); font-family: Calibri, sans-serif; font-size: 14.6667px;\">&nbsp;para que el corredor&nbsp;</span><span style=\"color: rgb(51, 51, 51); font-family: Calibri, sans-serif; font-size: 14.6667px;\">INTERLBROKER</span><span style=\"color: rgb(51, 51, 51); font-family: Calibri, sans-serif; font-size: 14.6667px;\">&nbsp; realice la cotización respectiva.</span></p>', 'REMOTO', 1, 'MARIO PALOMO', 1, '2020-05-25 18:54:29', '2020-05-25 18:54:29');
INSERT INTO `incidencia` VALUES (2, '<p><span style=\"color: rgb(51, 51, 51); font-family: monospace; font-size: 12px;\">No se esta duplicando ningún pago, el valor nuevo que sale en la cotización es para cuando el cliente pague la prima que falta del vehículo.</span><br style=\"color: rgb(51, 51, 51); font-family: monospace; font-size: 12px;\"><span style=\"color: rgb(51, 51, 51); font-family: monospace; font-size: 12px;\">El valor se le aumento ya que estamos a la espera del pago y posteriormente a la emisión de la póliza de vehículo.</span><br></p>', 'REMOTO', 1, 'MARIO PALOMO', 2, '2020-05-26 16:11:07', '2020-05-26 16:11:07');
INSERT INTO `incidencia` VALUES (3, '<p>Se ha procedido con la habilitación del usuario con el número de RUC&nbsp;<span style=\"color: rgb(51, 51, 51); font-family: Calibri, sans-serif; font-size: 14.6667px;\">1891724760001</span></p>', 'REMOTO', 1, 'MARIO PALOMO', 3, '2020-05-26 16:16:47', '2020-05-26 16:16:47');
INSERT INTO `incidencia` VALUES (4, 'Se procedió con la habilitación del link de producción del formulario de pago de DATAFAST.', 'REMOTO', 1, 'MARIO PALOMO', 4, '2020-05-26 16:19:04', '2020-05-26 16:19:04');
INSERT INTO `incidencia` VALUES (5, '<p><span style=\"color: rgb(0, 0, 0); font-family: monospace; font-size: 13.3333px;\">Estimados,</span><br style=\"color: rgb(0, 0, 0); font-family: monospace; font-size: 13.3333px;\"><br style=\"color: rgb(0, 0, 0); font-family: monospace; font-size: 13.3333px;\"><span style=\"color: rgb(0, 0, 0); font-family: monospace; font-size: 13.3333px;\">Se ha procedido con la corrección del error, por favor verificar nuevamente.</span><br style=\"color: rgb(0, 0, 0); font-family: monospace; font-size: 13.3333px;\"><br style=\"color: rgb(0, 0, 0); font-family: monospace; font-size: 13.3333px;\"><span style=\"color: rgb(0, 0, 0); font-family: monospace; font-size: 13.3333px;\">Adjunto la plataforma funcionando con el usuario mencionado:</span><br style=\"color: rgb(0, 0, 0); font-family: monospace; font-size: 13.3333px;\"></p><p><img src=\"data:image/png;base64,\" data-filename=\"image.png\" style=\"width: 25%;\"><br></p>', 'REMOTO', 1, 'MARIO PALOMO', 5, '2020-05-26 16:26:07', '2020-05-26 16:26:07');
INSERT INTO `incidencia` VALUES (6, '<div class=\"pre\" style=\"margin: 0px; padding: 0px; font-family: monospace; color: rgb(0, 0, 0); font-size: 13.3333px;\">Estimados,<br><br>Pueden proceder a probar la herramienta, ya se encuentra solucionado el problema. <br>(Se refrescaron lo servicios de la nube)</div><div class=\"pre\" style=\"margin: 0px; padding: 0px; font-family: monospace; color: rgb(0, 0, 0); font-size: 13.3333px;\">Usuarios:&nbsp;<a href=\"mailto:BGUAMA@segurosequinoccial.com\" data-mce-href=\"mailto:BGUAMA@segurosequinoccial.com\">BGUAMA@segurosequinoccial.com</a></div><div class=\"pre\" style=\"margin: 0px; padding: 0px; font-family: monospace; color: rgb(0, 0, 0); font-size: 13.3333px;\"><span style=\"font-size: 13.3333px;\">Usuarios:&nbsp;</span><a href=\"mailto:MVALENCIA@segurosequinoccial.com\" data-mce-href=\"mailto:MVALENCIA@segurosequinoccial.com\" style=\"font-size: 13.3333px; background-color: rgb(255, 255, 255);\">MVALENCIA@segurosequinoccial.com</a><span style=\"font-size: 13.3333px;\">&nbsp;</span></div><div class=\"pre\" style=\"margin: 0px; padding: 0px; font-family: monospace; color: rgb(0, 0, 0); font-size: 13.3333px;\"><img src=\"data:image/png;base64,\" data-filename=\"image.png\" style=\"width: 25%;\"><span style=\"font-size: 13.3333px;\"><br></span><br></div>', 'REMOTO', 1, 'MARIO PALOMO', 6, '2020-05-26 16:35:46', '2020-05-26 16:35:46');
INSERT INTO `incidencia` VALUES (7, '<p>Todos los problemas con ese mensaje de error al cargar el formulario del pago ya se solucionaron.</p>', 'REMOTO', 1, 'MARIO PALOMO', 7, '2020-05-26 16:39:06', '2020-05-26 16:39:06');
INSERT INTO `incidencia` VALUES (8, '<p>Se procedió con la actualización del link de producción de PAYPHONE para que los diferidos y pagos se realicen son problemas.</p>', 'REMOTO', 1, 'MARIO PALOMO', 8, '2020-05-26 16:44:31', '2020-05-26 16:44:31');

